import AudioPlayer from 'react-h5-audio-player';
import React from 'react';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {Button, Container, Nav, Row, Col, Form, FormControl} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './home.css'
import ReactDOM from 'react-dom';
import 'react-h5-audio-player/lib/styles.css'; // Import the CSS for the audio player

const PlayerApp = () => {
  return (
    <div className="container">
      <AudioPlayer
        src="https://www.soundhelix.com/examples/mp3/SoundHelix-Song-9.mp3"
        volume={0.7}
        // Try other props!
      />
    </div>
  );
};

ReactDOM.render(<PlayerApp />, document.getElementById('root'));
